commit.message:
Signal.connected_to should always disconnect the receiver

Bug introduced by 33a14971c34fcd15deb2b18b50c9bd411eb6ed74 which replaced

    try:
        yield None
    except:
        self.disconnect(receiver)
        raise
    else:
        self.disconnect(receiver)

with

    try:
        yield None
    except Exception as e:
        self.disconnect(receiver)
        raise
    else:
        self.disconnect(receiver)

which are not semantically the same, as the latter does not disconnect
the receiver if an instance of BaseException is raised. Notably,
asyncio.CancelledError is a subclass of BaseException on Python 3.8+
